import logo from './logo.svg';
import './App.css';

function App() {
  function handleBuyClick() {
    return null;
  }

  function Button() {
    return (
      <button data-js="buy-btn" onClick={handleBuyClick}>Buy</button>
    );
  }

  return (
    <main className="container main">
      <p>Total: <span className="value-field" data-js="total-value"></span></p>
      <p>Price: <span className="value-field" data-js="price-value"></span></p>
      <Button />
    </main>
  );
}

export default App;
